package main

func reversString(s string) string  {
	runes := []rune(s)
	for i, j := 0, len(runes) - 1; i < j; i, j = i + 1, j - 1 {
		runes[i], runes[j] = runes[j], runes[i]
	}
	return string(runes)
}

func isPalindrome(s string) bool {
	var low, high int
	high = len(s) - 1
	for low < high {
		if s[low] != s[high] {
			return false
		}
		low ++
		high --
	}
	return true
}

